import React from 'react';

const PriceLoad = (props) =>{
	const priceSplit = () =>{
		return (props.price/100).toFixed(2)
	}
	return(
		<div className="col-6 mb-cons">
			<p className="price">{priceSplit}</p>
		</div>
	)
};
export default PriceLoad;
